import TripData from "./TripData";
import "./trip_style.css";


export default function Trip(props){

    return(
        <div className="trip">
            <h1>{props.h1}</h1>
            <p></p>
            <div className="trip-card">
                {
                    props.data.map((item) => {
                        return(
                            <TripData src={item.src} heading={item.title} text={item.text}/>
                        );
                    })
                }
            </div>

        </div>
    );
}
